import { StatusBar } from 'expo-status-bar';
import React, {useState} from 'react';
import { StyleSheet, Text, View, Button } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <Text style={ styles.titleText}>Welcome to Door2Door !!</Text>
      <Button title="Search by Vendor" style={styles.buttonStyle}></Button>
      <Button title="Vendors Near Me" style={styles.buttonStyle}></Button>
      <Button title="Search by Location" style={styles.buttonStyle}></Button>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'black',
    alignItems: 'center',
    justifyContent: 'center',
    width:'auto',
    height: 'auto',
  },
  titleText: {
    fontSize:25,
    fontFamily:'lucida grande',
    fontWeight:'bold',
    color:'white',
    justifyContent:'center'
  },
   buttonStyle: {
    marginBottom:20,
    padding:30,
    fontSize:20,
    fontFamily:'lucida grande',
    fontWeight:'bold',
    color:'white',
    //justifyContent:'center',
  },
});
